class Solution {
  int minimumPossibleSum(int n, int target) {
    final mod = 1000000007;
    if (target % 2 == 0) {
      if (n > target ~/ 2) {
        return ((target - 1) * (n - target ~/ 2) % mod +
                ((target ~/ 2) * (target ~/ 2 - 1) ~/ 2) % mod) %
            mod;
      } else {
        return (n * (n + 1) ~/ 2) % mod;
      }
    } else {
      if (n >= (target + 1) ~/ 2) {
        return ((target - 1) * (n - (target - 1) ~/ 2) % mod +
                (((target - 1) ~/ 2) * ((target - 1) ~/ 2 + 1) ~/ 2) % mod) %
            mod;
      } else {
        return (n * (n + 1) ~/ 2) % mod;
      }
    }
  }
}
